function SearchBar() {
    return (
        <form action="/" method="get" className="docs_col">
            <label htmlFor="header-search">
                <span className="placeholder">Search Documents</span>
            </label>
            <input
                type="text"
                id="header-search"
                placeholder="Search documents" 
            />
            <button type="submit">Search</button>
        </form>
    );
}

export default SearchBar;
